## dartdoc_macro_reference

## Description

"Only use macros with pre-defined templates"

## Details

Currently, there is no safeguard for dartdoc macros.

When writing:

```dart
/// {@macro whatever}
var x;
```

there is nothing that checks `whatever` matches with a valid `{@template whatever}` defined previously.

So if a typo is made when using the macro, or if somehow during refactoring a template is renamed/removed, this would break the documentation.

A lint cold be added to verify that the macro string correctly has a template

## Kind

info, like most of the other lints

## Good Examples 


```dart
/// {@template whatever}
/// {@endtemplate}
var a;

/// {@macro whatever} // "whatever" correctly exists as a template
var b;
```

## Bad Examples

```dart
/// {@template whatever}
/// {@endtemplate}
var a;

/// {@macro not_found} 
     ^^^^^^^ // There's no template with the key "not_found"
var b;
```

In the Codelab:  [Intro to Dart for Java Developers](https://codelabs.developers.google.com/codelabs/from-java-to-dart/#1), illustration of read-only properties is confusing.

> The original Java example defines speed as a read-only variable—it declares it as private and provides only a getter.

In the related Java code, `speed` is not _read-only_ property, this is shown in: 

```        
    private int speed;

    public void applyBrake(int decrement) {
        speed -= decrement;
    }

    public void speedUp(int increment) {
        speed += increment;
    }
```

Also: 

> You can convert speed to read-only by changing its name and adding a getter.
> **Make speed a private, read-only instance variable**

In Dart code, `speed` was made _private_ by adding `_`, but it is not _read-only_ as shown in: 

```
  void applyBrake(int decrement) {
    _speed -= decrement;
  }

  void speedUp(int increment) {
    _speed += increment;
  }
```

the public _getter_ `get speed` can be considered read-only variable not the private instance variable` _speed`.

